import React from "react";
import "./MemeGenerator.css";

const header = () => {
  return (
    <div>
      <header>
        <img
          className="logo"
          src="http://www.pngall.com/wp-content/uploads/2016/05/Trollface.png"
          alt="Proble?"
        />
        <p>Meme Generator Section</p>
      </header>
    </div>
  );
};
export default header;
